A tooltip is a small box that appears when you hover over an element. It is used to provide additional information about the element.

## React Context

React Context is a way to pass data from a parent component to a child component without having to pass the data through every level of the component tree. It is useful for passing data that is needed by many components, such as theme data or user data.

