We will then create a Tooltip component that uses the TooltipContext to display the Tooltip. The Tooltip component will take in a children prop, which is the element that the Tooltip will be attached to.

The Tooltip component will also take in a trigger prop, which is the event that will open the Tooltip. The trigger prop can be a string, such as 'hover', or a function, such as a click handler.

The Tooltip component will use the useContext hook to access the TooltipContext and update the state of the Tooltip.

## Closing the Previously Opened Tooltip

To close the previously opened Tooltip, we will need to keep track of the currently open Tooltip. We can do this by adding a currentTooltip state to the TooltipContext.

When a Tooltip is opened, we will set the currentTooltip state to the new Tooltip. When a Tooltip is closed, we will set the currentTooltip state to null.

We will then add a useEffect hook to the Tooltip component that closes the currently open Tooltip when the Tooltip is closed.

## Example

Here is an example of a Tooltip component that uses React Context to close the previously opened Tooltip:

```
import React, { createContext, useContext, useEffect, useRef, useState } from 'react';

const TooltipContext = createContext();

export function useTooltipContext() {
  return useContext(TooltipContext);
}

export function TooltipProvider({ children }) {
  const [currentTooltip, setCurrentTooltip] = useState(null);

  const tooltipRef = useRef();

  useEffect(() => {
    function handleClickOutside(event) {
      if (tooltipRef.current && !tooltipRef.current.contains(event.target)) {
        setCurrentTooltip(null);
      }
    }

    document.addEventListener("mousedown", handleClickOutside);

    return () => {
      document.removeEventListener("mousedown", handleClickOutside);
    };
  }, []);

  return (
    <TooltipContext.Provider value={{ currentTooltip, setCurrentTooltip }}>
      {children}
      {currentTooltip && (
        <div ref={tooltipRef} className="tooltip">
          {currentTooltip.content}
        </div>
      )}
    </TooltipContext.Provider>
  );
}

export function Tooltip({ children, trigger, content }) {
  const { currentTooltip, setCurrentTooltip } = useTooltipContext();

  function handleTrigger() {
    if (currentTooltip && currentTooltip !== content) {
      setCurrentTooltip(null);
    }

    setCurrentTooltip(content);
  }

