  String input;
  while (Serial.available() == 0) {} // wait for input
  while (Serial.available() > 0) {
    char c = Serial.read();
    if (c == '\n') break;
    input += c;
  }

  // convert the input text to Morse code
  for (int i = 0; i < input.length(); i++) {
    char c = input.charAt(i);
    if (c >= 'A' && c <= 'Z') {
      c = c - 'A' + 'a';
    }
    if (c < 'a' || c > 'z') {
      Serial.print("Invalid character: ");
      Serial.println(c);
      continue;
    }
    int index = c - 'a';
    String morse = morseCode[index];

    // output the Morse code using the buzzer
    for (int j = 0; j < morse.length(); j++) {
      char element = morse.charAt(j);
      if (element == '.') {
        tone(9, 1000, dotDuration);
      } else if (element == '-') {
        tone(9, 1000, dashDuration);
      }
      if (j < morse.length() - 1) {
        delay(spaceDuration);
      }
    }
    delay(letterSpaceDuration);
  }
  delay(wordSpaceDuration);
}

void tone(int pin, int frequency, int duration) {
  digitalWrite(pin, HIGH);
  long start = millis();
  while (millis() - start < duration) {
    float d = (float)duration / (float)frequency;
    delayMicroseconds((long)(d * 1000));
  }
  digitalWrite(pin, LOW);
}
