  const view = new DataView(buf);
  const entities = [];
  for (let i = 0; i < view.byteLength; i++) {
    const entity = {
      id: view.getUint8(i) >> 3,
      size: view.getUint8(i) & 0x07
    };
    entities.push(entity);
  }
  return entities;
}
