int request\_cs\_clean(const void \*self) {
 Message request = createMessage(MESSAGE\_MAGIC, 0,0,0, CS\_REQUEST);
 Info new\_info;
 new\_info.time = time\_clock;
 new\_info.id = id;
 push(new\_info);
 send\_multicast(&id, &request);
 while (!entered\_mutex()) {
 Message received;
 local\_id from = get(&received);
 if (from > 0) {
 process\_message(&received);
 }
 }
 return 0;
}

void process\_message(Message *received) {
 switch (received->s\_header.s\_type) {
 case CS\_REQUEST: {
 Message response = createMessage(MESSAGE\_MAGIC, 0, 0, 0, CS\_REPLY);
 Info new\_info;
 new\_info.id = received->s\_header.s\_local\_id;
 new\_info.time = received->s\_header.s\_local\_time;
 push(new\_info);
 fprintf(EventsLog, "%d: process %i CS\_REQUEST from %i\n",time\_clock, id, received->s\_header.s\_local\_id);
 fflush(EventsLog);
 send(&id, received->s\_header.s\_local\_id, &response);
 break;
 }
 case CS\_REPLY: {
 set\_reply(received->s\_header.s\_local\_id);
 fprintf(EventsLog, "process %i CS\_REPLY from %i\n", id, received->s\_header.s\_local\_id);
 fflush(EventsLog);
 break;
 }
 case CS\_RELEASE: {
 if (queue.info[0].id == received->s\_header.s\_local\_id) {
 pop();
 }
 fprintf(EventsLog, "process %i CS\_RELEASE from %i\n", id, received->s\_header.s\_local\_id);
 fflush(EventsLog);
 break;
 }
 case DONE: {
 set\_done(received->s\_header.s\_local\_id);
 fprintf(EventsLog, "process %i DONE from %i", id, received->s\_header.s\_local\_id);
 fflush(EventsLog);
 }
 default: {
 break;
 }
 }
}

int release\_cs\_clean(const void \*self) {
 pop();
 Message release = createMessage(MESSAGE\_MAGIC, 0,0,0,CS\_RELEASE);
 for (int i = 1; i <= process\_count; i++) {
 queue.replies[i] = id != i ? 0 : 1;
 }
 send\_multicast(&id, &release);
 return 0;
}

int exit\_mutex\_clean() {
 for (int i = 1; i <= process\_count; i++){
 if (queue.done[i] == 0)
 return 0;
 }
 return 1;
}

int entered\_mutex\_clean() {
 if (queue.info[0].id == id) {
 for(int i = 1; i<=process\_count; i++) {
 if (queue.replies[i] == 0){
 return 0;
 }
 }
 } else {
 return 0;
 }
 return 1;
}

